window.bookSummaryJSON = "<p>Earth's Diaspora is well underway and the colonies are flourishing. There are Dynasties of The Accord, however, that resent Earth's expansion. Charli Morgan and Lucca Spelini each lead their respective teams from colony to colony, preventing interference and keeping the peace. </p> <p>Standing up to the Dynasties is one thing, but what happens when Lower Houses of The Accord start butting in? </p> <p>Dr. Mark Spencer hasn't been heard from in years until he suddenly shows up one day. The news he brings...isn't good. </p>"; 
